import './inputs.css'

const Searching = ({
  filterText,
  filterTextChange
}) => {
  return (
    <form className='form'>
      <link rel='stylesheet' href='https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css' />
      <input 
      type='text'
      value={filterText} 
      placeholder='&#xf002; Hae laitetta' 
      onChange={(e) => filterTextChange(e.target.value)}
      className="search"
      style={{height: '30px', }}/>
    </form>
  )
}

export default Searching
